import React, { useState } from "react"

function Butty(props) {
  const [count] = useState(0)
  return (
    <div>
      <button>
        {count}
        {props.name}
      </button>
    </div>
  )
}
Butty.defaultProps = {
  name: "Likes"
}

export default Butty
